    okane: "好奇心旺盛なあなたは、お金よりも自分に興味をもつことが優先され、自分がどれだけの成長と達成感を得ることができるかを重視する傾向が。そんな訳で、お金のこととなると割合に無頓着で興味のあることだけに使いすぎるようです。また、意欲的に仕事に取組む、完璧を目指す姿勢はあなたの美徳ですが、ときには、情緒豊かな人物との交流が大事です。相手の会話術を取り入れると人間関係が円滑になって、人脈も広がり自分の成長と金運上昇にもつながっていくでしょう。",
    kenkou: "不慮の事故による肩の脱臼などに注意が必要。無理を重ねると、肩こりに悩まされ、疲労や精神的なストレスが元になって動脈硬化・高血圧や血行障害からくる心臓病を患いやすくなる他、肝臓・すい臓・胃腸などにポリープや腫瘍が出来てしまう危険もあります。定期的な健診を忘れずに。",
    renai: "しなやかで若々しいあなたは、異性からの憧れの的になりやすくモテるタイプです。ときとして、外堀を埋めてから行動に移す冷静な面があります。しかし、ひとたび恋愛に発展すると支配的傾向が。愛する人の些細な欠点に目くじらを立てたり、行動に注文をつけたりしないこと。また、恋愛に対して、気恥しさが働いてしまいがちなので、素直な気持ちで接しましょう。年下の異性のほうが気軽に付き合えて意外と上手くいく暗示が。",
    kaiunn: "想像力を思う存分に働かせること。自分の理想を追い求め、自分のなりたい人物像を心の中に保ち続ければ、イメージ通りの人生に。物づくりなどクリエイティブな活動も運気の底上げになります。そうしたことが感性を刺激して、新たなチャンスへとつながるでしょう。また、恵まれた才能を活かし、人を束ねていく統率力を発揮することも大切です。"
